-- get year out of date --
CREATE FUNCTION My_Year( datum date ) returns integer as 
return num(substr(datum,1,4));

-- get month out of date --
CREATE FUNCTION My_Month( datum date ) returns integer as 
return num(substr(datum,6,2));

-- get day out of date --
CREATE FUNCTION My_Day( datum date ) returns integer as
return num(substr(datum,9,2));

-- Zeller's Congruence is an algorithm that calculates a day of the week given
-- a year, month and day. Created in 1887(!). Jeff Duntemann of PC Techniques
-- fame implemented it in TP in the 11/90 issue of Dr Dobbs Journal, With a
-- (115 min left), (H)elp, More? major kludge because TP's MOD operator returns a remainder instead of a
-- True mathematical modulus. 

create Function My_DayOfWeek(datum date) returns Integer as
Var
      y int; m int; d int; Century int;  Holder  int;
      y = My_Year(DATUM);
      m = My_Month(DATUM) ;
      d = My_Day(DATUM);

BEGIN
      /* Do the Zeller's Congruence calculation as Zeller himself  */
      /* described it in "Acta Mathematica" #7, Stockhold, 1887.  */
      BEGIN
          /* First we separate out the year and the century figures: */
          Century = My_Div ( y, 100 );
          y       = My_Mod ( y, 100 );
          /* Next we adjust the month such that March remains month #3, */
          /* but that January and February are months #13 and #14,      */
          /* *but of the previous year*:                                                               */
          IF ( m < 3 ) THEN
          BEGIN
              m = m + 12;
              IF ( y > 0 ) THEN
                    y = y - 1                            /* The year before 2000 is */
              ELSE                                       /* 1999, not 20-1...       */
                   BEGIN
                        y = 99;
                        Century = Century - 1;
                    END;
           END;

    /* Here's Zeller's seminal black magic: */
    Holder = d;                                   /* Start With the day of month */
    Holder = Holder + My_Div(((m + 1) * 26), 10); /* Calc the increment */
    Holder = Holder + y;                          /* Add in the year */
    Holder = Holder + My_Div(y,4);                /* Correct For leap years  */
    Holder = Holder + My_Div(Century, 4);  /* Correct For century years */
    Holder = Holder - Century - Century;   /* DON'T KNOW WHY HE DID THIS! */
    /************************KLUDGE ALERT!****************************/
    While (Holder < 0) do                   /* Get negative values up into */
          Holder = Holder  + 7;             /* positive territory before */
                                            /* taking the MOD...         */
    Holder = My_Mod(Holder,7);              /* Divide by 7 but keep the  */
                                            /* remainder rather than the */
                                            /* quotient */
    /***********************KLUDGE ALERT!***************************/
    /* Here we "wrap" Saturday around to be the last day: */
    if (Holder = 0) then
      Holder = 7;

    /* Zeller kept the Sunday = 1 origin; */
  end;
end;
return Holder;

-- convert integer of dayofweek to name of day --
CREATE FUNCTION My_DayOfWeekByName ( datum  DATE ) RETURNS varchar AS
VAR l_datum date;
set l_datum = datum;	
CASE 
	WHEN My_DayOfWeek( l_datum ) = 1 THEN return 'sunday';
	WHEN My_DayOfWeek( l_datum ) = 2 THEN return 'monday';
	WHEN My_DayOfWeek( l_datum ) = 3 THEN return 'thuesday';
	WHEN My_DayOfWeek( l_datum ) = 4 THEN return 'wednesday';
	WHEN My_DayOfWeek( l_datum ) = 5 THEN return 'thursday';
	WHEN My_DayOfWeek( l_datum ) = 6 THEN return 'friday';
	WHEN My_DayOfWeek( l_datum ) = 7 THEN return 'saturday';
	ELSE STOP(-29000, 'wrong My_DayOfWeek result');
END CASE;

