-- try recursive call
create function fib(num int, i int) returns int as
if ( i = num ) then return num;
return i + fib(num, i+1);

-- try recursive call
create function fibonacci( num int)  returns int as
   if ( num < 1 ) then return NULL;
   if (NUM < 3) then return 1;
return 1 + fib(num, 3);

CREATE FUNCTION avg_price (zip CHAR(5)) returns FIXED(6,2) 
AS
    VAR sum FIXED(10,2); price FIXED(6,2); hotels INTEGER;
TRY
  SET sum = 0; SET hotels = 0;
  SELECT price FROM user.room,user.hotel WHERE zip = :zip AND
  room.hno = hotel.hno AND roomtype = 'single';
    WHILE $rc = 0 DO BEGIN
      FETCH INTO :price;
      SET sum = sum + price;
      SET hotels = hotels + 1;
    END;
CATCH
  IF $rc <> 100 THEN STOP ($rc, 'unexpected error');
IF hotels > 0 THEN RETURN sum / hotels
ELSE 
  RETURN NULL;

create function germansort (s varchar) returns varchar deterministic as
var
len integer;
ix  integer;
c   char;
buf char(500);
buf='';
len = length(s);
ix  = 1;
while ix <= len do
  begin
  c = substr(s, ix, 1);
  case c
  when ''  then buf = buf || 'ae';
  when ''  then buf = buf || 'oe';
  when ''  then buf = buf || 'ue';
  when ''  then buf = buf || 'ss';
  when ''  then buf = buf || 'Ae';
  when ''  then buf = buf || 'Oe';
  when ''  then buf = buf || 'Ue';
  else
    buf = buf || c;
  end case;
  ix = ix + 1;
  end;
return buf;

